import{_ as e,c as r,o as a,a as l}from"./app.536cdada.js";const m=JSON.parse('{"title":"内核源码获取","description":"","frontmatter":{},"headers":[{"level":2,"title":"Github 获取源码","slug":"github-获取源码","link":"#github-获取源码","children":[]},{"level":2,"title":"各厂商开源","slug":"各厂商开源","link":"#各厂商开源","children":[]},{"level":2,"title":"其他方法","slug":"其他方法","link":"#其他方法","children":[]},{"level":2,"title":"参考","slug":"参考","link":"#参考","children":[]}],"relativePath":"Topic/Android/Kernel/How to compile a kernel/1.Get kernel source.md","lastUpdated":1678597470000}'),n={name:"Topic/Android/Kernel/How to compile a kernel/1.Get kernel source.md"},t=l(`<h1 id="内核源码获取" tabindex="-1">内核源码获取 <a class="header-anchor" href="#内核源码获取" aria-hidden="true">#</a></h1><blockquote><p>本教程将基于小米 10S 的内核源码进行实例，其他型号的手机请自行寻找内核源码。具体内容可以参考我的<a href="https://github.com/DogDayAndroid/KSU_Thyme_BuildBot" target="_blank" rel="noreferrer">内核编译项目</a>。</p></blockquote><p>通过上一节的知识，我们已经知道了如何获取设备代号和当前内核版本。</p><h2 id="github-获取源码" tabindex="-1">Github 获取源码 <a class="header-anchor" href="#github-获取源码" aria-hidden="true">#</a></h2><p>内核源码的一般格式为 <code>[android_]kernel_设备厂商_cpu/代号</code>，例如，小米 10S（thyme）的代号为 <code>thyme</code>, CPU 型号为 <code>sm8250</code>，生产厂商为 <code>xiaomi</code>，则搜索格式应为下面几种：</p><div class="language-bash"><button title="Copy Code" class="copy"></button><span class="lang">bash</span><pre class="shiki material-theme-palenight" tabindex="0"><code><span class="line"><span style="color:#FFCB6B;">kernel_xiaomi_thyme</span></span>
<span class="line"><span style="color:#FFCB6B;">kernel_xiaomi_sm8250</span></span>
<span class="line"><span style="color:#FFCB6B;">android_kernel_xiaomi_thyme</span></span>
<span class="line"><span style="color:#FFCB6B;">android_kernel_xiaomi_sm8250</span></span>
<span class="line"></span></code></pre></div><p>以下是我收集的一些小米 10S（thyme）的源码仓库：</p><ul><li><a href="https://github.com/Lynnrin-Studio/android_kernel_xiaomi_thyme" target="_blank" rel="noreferrer">Lynnrin-Studio/android_kernel_xiaomi_thyme</a>: 这是我目前编译内核所使用的内核源码。</li><li><a href="https://github.com/UtsavBalar1231/kernel_xiaomi_sm8250" target="_blank" rel="noreferrer">UtsavBalar1231/kernel_xiaomi_sm8250</a>: CLO 内核升级为 CAF 标签 <code>LA.UM.9.12.r1-14700-SMxx50</code>，AOSP 源码同步上游 <code>android-4.19-stable</code>。</li><li><a href="https://github.com/WeeAris/RK-KSU-mi-kernel-SM8250" target="_blank" rel="noreferrer">WeeAris/RK-KSU-mi-kernel-SM8250</a>: 支持 <code>KernelSU</code> 的 <a href="https://github.com/Rohail33/RealKing-kernel-SM8250.git" target="_blank" rel="noreferrer">Rohail33/RealKing-kernel-SM8250</a> 分支。</li><li><a href="https://github.com/Official-Ayrton990/android_kernel_xiaomi_sm8250" target="_blank" rel="noreferrer">Rohail33/RealKing-kernel-SM8250</a>: 基于 <code>LA.UM.9.12.r1-08000-SMxx50.0</code> 标签的内核。</li></ul><p>当然除此之外还有很多源码，但这些源码对于我来说是我前期学习的一个途径，因此在这里列出给大家。</p><h2 id="各厂商开源" tabindex="-1">各厂商开源 <a class="header-anchor" href="#各厂商开源" aria-hidden="true">#</a></h2><ul><li><a href="https://github.com/MiCode/Xiaomi_Kernel_OpenSource/" target="_blank" rel="noreferrer">小米内核开源</a></li><li><a href="https://consumer.huawei.com/en/opensource/" target="_blank" rel="noreferrer">华为开源代码</a></li></ul><h2 id="其他方法" tabindex="-1">其他方法 <a class="header-anchor" href="#其他方法" aria-hidden="true">#</a></h2><ul><li>去<a href="https://forum.xda-developers.com/" target="_blank" rel="noreferrer">XDA 论坛</a>等手机社区找源码</li></ul><h2 id="参考" tabindex="-1">参考 <a class="header-anchor" href="#参考" aria-hidden="true">#</a></h2><ul><li><a href="https://parrotsec-cn.org/t/topic/2168" target="_blank" rel="noreferrer">自己编译定制一个牛逼的安卓内核</a></li><li><a href="https://sspai.com/post/56296" target="_blank" rel="noreferrer">让 Android 手机更省电流畅，你可以试试「刷内核」</a></li></ul>`,15),i=[t];function o(s,d,c,h,_,p){return a(),r("div",null,i)}const k=e(n,[["render",o]]);export{m as __pageData,k as default};
